import { Container, Typography, Box, TextField } from "@mui/material";
import React from "react";
import { Link } from "react-router-dom";




export default function SignUp(){
    return(
        <Container component={"div"} sx={{pt:"50px", pb:"50px", display:"flex", justifyContent:"center", alignItems:"center", flexDirection:"column"}}>
            <Typography component={"h2"} sx={{color:"#5CB85C", fontSize:"30px"}}>
                Sign Up 
            </Typography>
            <Link to='/signin' className="haveAnAccount" style={{color:"#5CB85C"}}> Have An Account </Link>
            <Box component={"form"} sx={{width:"70%", display:"flex", justifyContent:"center", alignItems:"center", flexDirection:"column" }}>
                <TextField id="username" label="Username" variant="outlined" sx={{mt:"30px", mb:"30px", width:"70%"}}/>
                <TextField id="email" label="Email" variant="outlined" sx={{mb:"30px", width:"70%"}}/>
                <TextField id="pass" label="Password" variant="outlined" sx={{ mb:"30px", width:"70%"}}/>
            </Box>
        </Container>
    )
}
